  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Louisa and Keithsburg
  National Wildlife Refuges outlines Refuge accomplishments from January - April of
  1954. The report begins by summarizing the weather conditions, water conditions,
  and food and cover during this period. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, raptors, and fish- is also covered. The
  Refuge development and maintenance section discusses physical developments. The
  public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, fishing, and violations. Items of interest and N-R
  forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
